import React, { Component } from "react";
import VideoViewNavbar from "../videoViewNavbar/videoViewNavbar";
import ReactPlayer from "react-player";
import "./panel.css";

class VideoItem extends Component {
  state = {};
  render() {
    return (
      <div className="viewer-dim viewer-border viewer-color">
        <div className="video-titles">
          {" "}
          <h4 style={{ float: "left" }}>{this.state.title}</h4>
          <h4 style={{ float: "right" }}>{this.getViews()}</h4>
        </div>
        <ReactPlayer
          url="https://www.youtube.com/embed/Ke90Tje7VS0"
          config={{
            youtube: {
              playerVars: {
                modestbranding: 1,
                controls: 1,
                showinfo: 0
              }
            },
            facebook: {
              appId: "420240272057124"
            }
          }}
          height="220px"
          width="400px"
        />
      </div>
    );
  }

  mapVideoList() {}
}

export default VideoItem;
